import './Posts.css';
import Post from "./Post/Post";

const Posts = () => {
	let posts_data = [
		{'id': 1, 'name': 'Post 1'},
		{'id': 2, 'name': 'Post 2'},
		{'id': 3, 'name': 'Post 3'},
		{'id': 4, 'name': 'Post 4'},
		{'id': 5, 'name': 'Post 5'},
		{'id': 6, 'name': 'Post 6'},
		{'id': 7, 'name': 'Post 7'},
	]

	return (
		<section className='posts'>
			<div className="posts__title">My posts</div>
			<div className="posts__items">
				<Post name={posts_data[0].name}/>
				<Post name={posts_data[1].name}/>
			</div>

			<div className="general_profile__title">Profile</div>
		</section>
	)
}

export default Posts;
